import React from "react";

// Advocate list tab. What's important here is state,
// wherein we are able to toggle between years.

const AdvocateList = () => {
  return (
    <div>
      <embed
        style={{ width: "70vw", height: "90vh" }}
        src="https://thecdm.sharepoint.com/sites/team_mpath/_layouts/15/Doc.aspx?sourcedoc={0209f084-4ebb-42d7-bc16-0a7ecf52ba8f}&action=embedview&AllowTyping=True&ActiveCell='AdvocateList'!B3&wdHideGridlines=True&wdHideHeaders=True&wdDownloadButton=True&wdInConfigurator=True"
      />
    </div>
  );
};

export default AdvocateList;
